// MainComponent.js
import React, { useState } from 'react';
import CustomModal from '../api/payament-service';

function MainComponent() {
  const [modalIsOpen, setModalIsOpen] = useState(false);

  const openModal = () => {
    setModalIsOpen(true);
  };

  const closeModal = () => {
    setModalIsOpen(false);
  };

  const handlePaymentSubmit = (paymentRising, cardId) => {
    // Perform the payment submission logic here, e.g., fetch to the backend API
    console.log('Payment Details:', paymentRising, cardId);

    // Close the modal after submission
    closeModal();
  };

  return (
    <div>
      <h1>Your App</h1>
      <button onClick={openModal}>Open Payment Modal</button>
      <CustomModal
        isOpen={modalIsOpen}
        onRequestClose={closeModal}
        onPaymentSubmit={handlePaymentSubmit}
      />
    </div>
  );
}

export default MainComponent;
